function connectWireTo(wire, sinkPin, conn) {
    // conn (if not null) is a connection that we are reconstructing
    this.showWireCompatible(wire, sinkPin);

    // Otherwise bind pins and provide relocation logic
    wire.pins = [this, sinkPin];
    wire.aligners = [
        lively.bindings.connect(
        this, "globalTransform", wire, "wireRealign"),
        lively.bindings.connect(
        sinkPin, "globalTransform", wire, "wireRealign")];

    // Wire-specific methods
    wire.addScript(this.wireRealign);
    wire.addScript( function remove() {  
        // break connections when remove a wire
        this.aligners.invoke("disconnect");
        if (this.dataConnection) this.dataConnection.disconnect();
        $super();
        });

    // And establish the data connection
    wire.dataConnection = conn ||
        lively.bindings.connect(
            this.owner, this.pinSpec.accessor, sinkPin.owner, sinkPin.pinSpec.accessor);

    // Add it to the wires on this pin (maybe no need?)
    if (!this.wires) this.wires = [];
    this.wires.push(wire);

    // Fire it once
    wire.dataConnection.update(this.owner[this.pinSpec.accessor]);
}

