function placeAt(pinLoc) {
    // Place me around my owner's bounds.
    // pinLoc is between 0 and 4, with 0 being topLeft 
    // and higer values progressing clockwise around the bounds
    var morph = this.owner;
    var pinRect = morph.innerBounds().expandBy(this.bounds().extent().x/2 - morph.getBorderWidth());
    var side = Math.floor(pinLoc);  // integer part of pinLoc
    var partway = pinLoc - side;  // fraction part
    var corners = pinRect.corners.map( function (c) {
        return pinRect[c](); });
    var c1 = corners[side%4], c2 = corners[(side+1)%4];
    var location = c1.addPt(c2.subPt(c1).scaleBy(partway));
    this.align(this.bounds().center(), location)
}

