function buildPartsList() {
    // do a global init in case new widgets have been added
    //** this.quackLikeMe();  // Handles newly addedmorphs when ticking
    this.owner.setTitle('Parts List on ' + 
        (this.domain ? this.domain.toString() : 'null target'));

    // Enumerate connectable morphs
    var dataGrid = this.get('PartsListGrid');
    var activeRow = dataGrid.getActiveRowIndex();
    var drivers = this.getInputConnections();
    var data = [], self = this;
    var clickMorph = null, clickMorphSpec = null, clickConn = null;
    var row = 0;
    this.knownMorphs()
        .select(function (m) {return m.pinSpecs})
        .forEach(function (m) {  // Populate the table
            m.pinSpecs.forEach(function(spec) {
                var conn = self.inputConnectorFor(m, spec, drivers);
                var lineItem = [m.getName()];
                lineItem.push(spec.accessor);
                lineItem.push(spec.modality);
                lineItem.push(self.valueStringFor(m, spec, conn));
                lineItem.push(self.ruleStringFor(m, spec, conn));
                data.push(lineItem);
                if (row == activeRow-1) {
                    clickMorph = m;
                    clickMorphSpec = spec;
                    clickConn = conn; }
                row++;
            });
        });

    if (clickMorph != null && (clickMorph !== this.activeMorph || clickMorphSpec.accessor != this.activeAccessor)) {
        // a new row has been clicked in the parts list
        console.log("new row: " + "row, conn = " + clickConn + ", morph = " + activeRow + ", " + clickMorph);
        this.initFormulaView(clickMorph, clickMorphSpec, clickConn);
    }

    dataGrid.setData(data);
    dataGrid.setColNames([' morph', ' pin', ' I/O', ' value', ' source']);
}

