function quackLikeMe() { // this.quackLikeMe()
    // Copy all methods of the pin trait to every other 
    // top-level submorph of this world for easy testing
    console.log("quack")
    this.installPinSpecs();
    var traitMethodNames = ['showPins', 'getPins'];
    var self = this;
    this.knownMorphs().forEach (function(m) {
        traitMethodNames.forEach(function(n) {
            m.addScript(self[n]); });
            if (m.isClip()) {
            // ClipMorphs must include pins in bounds
            m.addScript(function getBounds() {
                if (this.cachedBounds) return this.cachedBounds;
                var bounds = $super();
                var tfm = this.getTransform();
                this.getPins().forEach(function(pin) {
                    var pinBounds = tfm.transformRectToRect(pin.getBounds());
                    bounds = bounds.union(pinBounds);
                });
                return this.cachedBounds = bounds;
            })
        }
    });
}

