function chooseTargetStep() {
    var hand = $world.firstHand();
    var handPos = hand.getPosition();
    if (!hand.isPressed()) { // Track mouse with targetLine
        this.targetLine.verts[1] = handPos;
        this.targetLine.setVertices(this.targetLine.verts);
