function initFormulaView(clickMorph, clickMorphSpec, clickConn) {
    // a new row has been clicked in the parts list
    this.activeMorph = clickMorph;
    this.activeAccessor = clickMorphSpec.accessor;
    var editor = this.get('PartsListText');
    lively.bindings.disconnectAll(editor);
    editor.setTextString('');
    if (clickMorphSpec.modality != 'input') return;

    // If there is no connection, then make one for an init
    if (clickConn == null) clickConn = connect(clickMorph, "onLoad", clickMorph, clickMorphSpec.accessor);

    // Set up the text area to edit the converter as a formula
    var srcObj = clickConn.getSourceObj().getName();
    var srcSel = clickConn.getSourceAttrName();
    var srcObj2 = srcObj.charAt(0).toLowerCase() + srcObj.slice(1);
    var srcSel2 = srcSel.charAt(0).toUpperCase() + srcSel.slice(1);
    var tempName = srcObj2 + srcSel2;
    // Z.setq gets the result of this converter
    // every time X.value changes.
    editor.setTextString(clickConn.converterString ||
       ("// " + clickMorph.getName() + "." + clickMorphSpec.accessor +  " gets the result of this converter" + '\n// every time ' + srcObj + '.' + srcSel + ' changes.' + '\nfunction converter(' + tempName + ') { return ' + tempName + '; }'));
    editor.connection = clickConn;
    editor.addScript(function onFormulaAccept(source) {
        this.connection.setConverter(source);
        this.world() && this.world().alertOK('New converter installed.');
        try {
            this.connection.update(this.connection.sourceObj[this.connection.sourceAttrName]);
        } catch(e) {
            alert('Error updating:\n' + e);
        }
    });
    connect(editor, 'savedTextString', editor, 'onFormulaAccept');
}

