function placePin(pin, location) {
    // Place the pin around my bounds.
    // Location is between 0 and 4, with 0 being topLeft 
    // and higer values progressing clockwise around the bounds
    // this.placePin(this.protoPin, 1.5)
    var pinRect = this.innerBounds().expandBy(pin.bounds().extent().x/2 - this.getBorderWidth());
    var side = Math.floor(location);  // integer part;
    var partway = location - side;  // fraction;
    // console.log("location = " + location + ", side = " + side + ", partway = " + partway);
    var corners = pinRect.corners.map( function (c) {
        return pinRect[c](); });
    var c1 = corners[side%4], c2 = corners[(side+1)%4];
    var pinLoc = c1.addPt(c2.subPt(c1).scaleBy(partway));
    // console.log("c1 = " + c1 + ", c2 = " + c2 + ", pinLoc = " + pinLoc);
    pin.align(pin.bounds().center(), pinLoc)
}

